Неизданные тексты / Вступление: Г. Гудий

Примечание: Настоящим письмом представляется неизданный материал, составленный доктором филологических наук, профессором кафедры русского языка и культуры Московского государственного университета Г. Гудием. В статье рассматриваются вопросы теории литературной композиции в древнерусской литературе.

Для денормализации необходимо:
- Записать числа цифрами (например, "две" — 2);
- Записать аббревиатуры верхним регистром и без пробелов (например, "СССР" — СССР);
- Записать обычные дроби через косую черту (например, "две трети" — 2/3);
- Записать десятичные дроби через запятую (например, "два с половиной" — 2,5);
- Записать названия валют соответствующим символом (например, "$" — доллар, "€" — евро и т. д.);
- Разделить часы, минуты и секунды двоеточием (например, "14:30:25");
- Обозначать века римскими числами (например, XIII век — XIII) и порядковые номера правителей римскими цифрами (например, II Иван Грозный — II Иоанн Грозный).

После денормализации получаем:

